import React from 'react';

import WorkCard from '../components/WorkCard';
const Education=()=>{
    return( <div className="condiv">
    <h1 className="subtopic">My Education</h1>
    <WorkCard title="M.Tech Software Engineering" where="VIT University" from="July 2017" to="Present"/>
    <WorkCard title="SSLC | HSC" where="Islamiah Higher Secondary School" from="2011" to="2017"/>
    </div>)
}
export default Education;
